def compute_metric(query, test, metric="MCD"):

    if metric == "MCD":
        cos = torch.nn.CosineSimilarity(dim=1, eps=1e-6)
        return 1 - cos(query.unsqueeze(0), test.unsqueeze(0)).item()
    elif metric == "MED":
