def OffsetPosition(in_ra,in_dec,delta_ra,delta_dec):

    ra = in_ra
    dec = in_dec + delta_dec
    if dec > 90.:
        dec = 180 - dec
        ra = 180 + ra
    if dec < -90.:
        dec = -180 - dec
        ra = 180 + ra
    ra = ra + delta_ra
    if ra > 360.:
        ra = ra - 360.
    if ra < 0.:
