def alternator(iterable, frontFirst=True):

    res = iterable.copy()
    idx = 0
    flipper = frontFirst
    while len(iterable) > 0:
        if flipper:
            res[idx] = iterable.pop(0)
        else:
            res[idx] = iterable.pop(-1)
        flipper = not flipper
        idx += 1
    return res

def ceil(num):

    if int(num) < num:
        # num is positive float
        # e.g. int(2.5) = 2
        return int(num) + 1
    else:
        # num is integer, or num is negative float
        # e.g. int(2.0) = 2
        # e.g. int(-2.5) = -2
        return int(num)

