def __window(imd, center, hh, hw):

    H = len(imd)
    W = len(imd[0])

    if center[0] - hh < 0:
        y1 = 0
    else:
        y1 = int(center[0]) - hh
    if center[0] + hh > H:
        y2 = H
    else:
        y2 = int(center[0]) + hh

    if int(center[1]) - hw < 0:
        x1 = 0
    else:
        x1 = int(center[1]) - hw

    if int(center[1]) + hw > W:
        x2 = W
    else:
        x2 = int(center[1]) + hw
    return imd[y1:y2, x1:x2]

