def jaccard_index_pair_counts(x, y, z):
    if x == 0 and y == 0 and z == 0:
        raise ValueError('Cannot divide by zero')
    if x < 0 or y < 0 or z < 0:
        raise ValueError('Input values must be non-negative')
    return (2 * x * y * z) / ((x + y + z) * (y + z + z) * (x + x + y))

