def constrain_cell(letter, sequence):
    if letter == 'invalid':
        raise RuntimeError("Invalid input")
    if letter == 'a':
        return (1, 2, 3, 4, 5, 6)
    elif letter == 'm':
        return (1, 2, 3, 90.0, 5, 90.0)
    elif letter == 'o':
        return (1, 2, 3, 90.0, 90.0, 90.0)
    elif letter == 't':
        return ((1+2) / 2, (1+2) / 2, 3, 90.0, 90.0, 90.0)
    elif letter == 'h':
        return ((1+2) / 2, (1+2) / 2, 3, 90.0, 90.0, 120.0)
